/* eslint no-unused-vars: 0 */
import { html, svg, repeat, classMap, styleMap, ifDefined, unsafeHTML, scopeTag } from "@ui5/webcomponents-base/dist/renderer/LitRenderer.js";
import type UI5Element from "@ui5/webcomponents-base/dist/UI5Element.js";
import type ProductSwitch from "../../ProductSwitch.js";
import type { ClassMapValue } from "@ui5/webcomponents-base/dist/types.js";

function block0 (this: ProductSwitch, context: UI5Element, tags: string[], suffix: string | undefined) { return html`<div class="ui5-product-switch-root" role="list" aria-label="${ifDefined(this._ariaLabelText)}" @focusin=${this._onfocusin} @keydown=${this._onkeydown} @click="${this.handleProductSwitchItemClick}"><slot></slot></div>`;}


export default block0;
